

<style>
#maptooltip {
	width: 200px;
	min-height: 50px;
	max-height: 300px;
	border: 1px solid black;
	background: white;
	position: absolute;
	display: none;
	padding: 5px;
	overflow: hidden;
}
body.boxed #wrapper {
	overflow: inherit !important;
}
</style>

<script>

var tooltipDiv = null;

function setMapTooltip(txt) {
	if (tooltipDiv != null) {
		tooltipDiv.innerHTML = txt;
		if (txt != '') {
			tooltipDiv.style.display = 'block';
		} else {
			tooltipDiv.style.display = 'none';
		}
	}
}

setTimeout(function() {
	tooltipDiv = document.getElementById('maptooltip');
	document.onmousemove = function(event) {
		event = event || window.event;
		if (tooltipDiv != null) {
			var left = event.pageX + (event.pageX < 1500 ? 15 : -225);
			var top = event.pageY + (event.pageY < 1500 ? 15 : -70);
			tooltipDiv.style.left = left + 'px';
			tooltipDiv.style.top = top + 'px';
		}
	}
}, 500);

</script>

<div id="maptooltip">
</div>

